 const [color,setColr]=useState();
 document.body.style=`background-color: ${color};`;
  return (
    <div className='App'>
      <button onClick={()=>setColr('red')}>red</button>
      <button onClick={()=>setColr('yellow')}>yellow</button>
      <button onClick={()=>setColr('yellow')}>orange</button>
      <button>white</button>
    </div>
  )
}
